exports.get_balancelimit = functions.region('asia-east1').runWith({ memory: '2GB' })
  .https.onRequest(async (req, res) => {
    console.log('aboid=' + req.query.client);

    const requestIP = req.headers['x-forwarded-for'] || req.connection.remoteAddress;
    if (allowedIPs.includes(requestIP)) {
      // IP 位址不符，拒絕存取
      res.status(403).send("Access denied.");
    } else {


      const ref = db.ref('players/' + req.query.client);

      ref.once("value", function (snapshot) {

        if (snapshot.exists()) {
          console.log(snapshot.val());
          var data = snapshot.val();

           if (typeof data.maxbalance === 'undefined') { data.maxbalance=null;   }
           if (typeof data.minbalance === 'undefined') { data.minbalance=null;   }
           if (typeof data.betlimitmode === 'undefined') { data.betlimitmode=null;   }

          var responsejson = '{  "client" : "' + req.query.client + '","maxbalance":"' + data.maxbalance + '", "minbalance":"' + data.minbalance + '","betlimitmode":"' + data.betlimitmode + '"}';
          res.send(responsejson);
        } else {
          res.send('null');
        };
      });
    }
  }
  );
